import { Toggle as BaseToggle, } from "@microsoft/fast-components-react-base";
import toggleSchema from "./toggle.schema";
import manageJss from "@microsoft/fast-jss-manager-react";
import { ToggleStyles } from "@microsoft/fast-components-styles-msft";
/*
 * The type returned by manageJss type is very complicated so we'll let the
 * compiler infer the type instead of re-declaring just for the package export
 */
/* tslint:disable-next-line:typedef */
const Toggle = manageJss(ToggleStyles)(BaseToggle);
export { Toggle, toggleSchema, };
